                <meta charset="utf-8">                    
                <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/api/v1/h5p/ajax?action=","contents":{"cid-29150478":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"info\",\"color\":\"#598ff6\",\"hotspots\":[{\"position\":{\"x\":22.883295194508012,\"y\":6.463509316770185},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Du kannst bei den Analysefunktionen in ArcGIS online immer auf die Info-Buttons klicken, um mehr über jedes Feld zu erfahren.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Info-Button\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Info-Button\"},\"subContentId\":\"39505f81-f088-4ec1-a394-dbf1968e0b4e\"}],\"header\":\"Info-Button\"},{\"position\":{\"x\":13.272311212814644,\"y\":16.40139751552795},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Hier wird immer der Layer ausgewählt, an dessen Tabelle die anderen Daten angehängt werden sollen.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Kartenlayer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Kartenlayer\"},\"subContentId\":\"88d2c4ad-d8eb-43e5-97fe-99853932e41e\"}],\"header\":\"Kartenlayer\"},{\"position\":{\"x\":20.137299771167047,\"y\":25.391433747412005},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Als zweites wird das Element gewählt, dessen Tabelle an das erste angehängt werden soll. Der Sinn ist hier, dass ihr damit die noch unverortete Tabelle mit den Objekten in der Karte verbindet und dann später die Werte darstellen könnt.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Join-Layer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Join-Layer\"},\"subContentId\":\"69ba4f00-c25b-453f-b937-137003004e79\"}],\"header\":\"Join-Layer\"},{\"position\":{\"x\":0.9153318077803204,\"y\":41.86723602484472},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Es gibt in diesem Fall ja keine räumliche Verbindung, weil eure Eurostat-Tabelle eben nicht verortet ist. Ihr erstellt nun eine Verbindung auf der Basis von zwei übereinstimmenden Feldern.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Übereinstimmende Felder\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Übereinstimmende Felder\"},\"subContentId\":\"578b66aa-5134-4e82-af2a-d1e621659d02\"}],\"header\":\"Übereinstimmende Felder\"},{\"position\":{\"x\":12.356979405034325,\"y\":44.97282608695652},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Wählt hier das Zielfeld mit der NUTS-ID des erstens Layer und das Joinfeld aus dem zweiten Layer, welches ebenfalls die NUTS-ID enthält.</p>\\n\\n<p>Weitere Felder müsst ihr nicht wählen (es gibt in diesen Tabellen auch keine sinnvollen).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Felderauswahl\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Felderauswahl\"},\"subContentId\":\"4a9fb3d8-42e6-4b7d-aa91-ecda5ad50641\"}],\"header\":\"Felderauswahl\"},{\"position\":{\"x\":13.272311212814644,\"y\":58.22334368530021},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Ihr erstellt hier eine ganz klassische 1:1 Verbindung. Eine Zeile in der einen Tabelle entspricht immer einer Zeile in der zweiten Tabelle.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Eins zu eins verbinden\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Eins zu eins verbinden\"},\"subContentId\":\"b2df3502-101d-4b06-bdee-4e1155f36820\"}],\"header\":\"Eins zu eins verbinden\"},{\"position\":{\"x\":1.2585812356979404,\"y\":65.26268115942028},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Da es bei unserem JOIN hoffentlich keine Konflikte geben wird, könnt ihr die Standardeinstellungen einfach so übernehmen.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Konflikte\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Konflikte\"},\"subContentId\":\"cbf4418c-f69a-4de9-9616-e9fcba2ab9a1\"}],\"header\":\"Konflikte\"},{\"position\":{\"x\":0.5720823798627002,\"y\":73.33721532091097},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Weil in beiden Tabellen immer genau eine Zeile zur anderen passt, müsst ihr diesen Haken nicht setzen.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Alle Ziel-Features beibehalten\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Alle Ziel-Features beibehalten\"},\"subContentId\":\"d6ce9bc2-48b2-49bf-9eff-08c8cba7de36\"}],\"header\":\"Alle Ziel-Features beibehalten\"},{\"position\":{\"x\":13.958810068649885,\"y\":80.99767080745342},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Wählt einen sinnvollen Layernamen. Mit dem JOIN wird ein neuer Layer angelegt und in euren Inhalten gespeichert. Der heißt dann wie du an dieser Stelle festlegst.</p>\\n\\n<p><strong>Tipp:</strong> Es darf ja jeden Titel nur einmal in der Subskription der CAU geben. Wenn schon jemand anders den gleichen Namen verwendet hast und du deswegen eine Fehlermeldung bekommst, dann setz doch einfach deine Initialen hinter deinen Titel.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Layername\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Layername\"},\"subContentId\":\"b26982c4-9c02-42f8-a860-22ee8310fa04\"}],\"header\":\"Layername\"},{\"position\":{\"x\":15.789473684210526,\"y\":85.75957556935818},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Hier kannst du nun den Ordner auswählen, den du für dieses Projekt angelegt hast. Der JOIN erzeugt einen neuen Ergebnislayer und dieser wird dann in deinen Ordner gespeichert.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Ordnerwahl\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Ordnerwahl\"},\"subContentId\":\"44f733fa-5503-4d9c-bad0-2d372efb00a7\"}],\"header\":\"Ordnerwahl\"},{\"position\":{\"x\":2.517162471395881,\"y\":88.45108695652173},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Wenn der Haken gesetzt ist, wird die Funktion nur für Objekte angewendet, die du gerade rechts in der Kartenansicht siehst. In anderen Fällen kann das genau gewünscht sein. Heute haben wir aber sowieso einen Filter nur auf die Landkreise von SH gesetzt. Um Fehler zu vermeiden (wenn du z. B. zu nah herangezoomt hast und nicht ganz SH zu sehen ist), nimm den Haken bei aktuelle Kartenansicht heute lieber weg.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Aktuelle Kartenansicht\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Aktuelle Kartenansicht\"},\"subContentId\":\"b9bf4268-b6a9-4de0-b02a-d328f2c77e7e\"}],\"header\":\"Aktuelle Kartenansicht\"},{\"position\":{\"x\":2.631578947368421,\"y\":95.28338509316771},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Wir erstellen einen \\\"richtigen\\\" Layer und deswegen setzt du keinen Haken bei Ergebnis-Sicht.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Ergebnis-Sicht\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Ergebnis-Sicht\"},\"subContentId\":\"10f11515-b375-4c97-83ff-4c8dfe684e1f\"}],\"header\":\"Ergebnis-Sicht\"},{\"position\":{\"x\":24.37070938215103,\"y\":92.38483436853002},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Das Anwenden von Analysefunktionen verbraucht meistens einige Credits von deinem Accountguthaben. Hier kannst du vorher immer nachgucken, wie viele Credits verbraucht werden. Wenn deine Credits verbraucht sind, kann dir der Admin am Institut das Guthaben jederzeit wieder kostenlos hochsetzen!</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Credits\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Credits\"},\"subContentId\":\"50faeb46-cfb2-4a29-b647-e78f054aa46b\"}],\"header\":\"Credits\"},{\"position\":{\"x\":32.837528604118994,\"y\":83.27510351966873},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Hier seht ihr nochmal die Spalte mit dem Schlüsselattribut (NUTS-ID) in der Attributtabelle des Kartenlayers. Die dazu passende Spalte hat auch die Tabelle, die ihr selber aus Eurostat exportiert habt.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Schlüsselattribut\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Schlüsselattribut\"},\"subContentId\":\"6021b7bb-db66-4c09-b63c-71d1e0258a54\"}],\"header\":\"Schlüsselattribut\"},{\"position\":{\"x\":72.42562929061785,\"y\":37.5194099378882},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Noch haben die Objekte (=Landkreise in SH) noch keine Attributwerte, nach denen du gestalten kannst. Das ändern wir gerade mit dem JOIN.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"noch keine Werte\",\"authors\":[],\"changes\":[],\"extraTitle\":\"noch keine Werte\"},\"subContentId\":\"3ab6e6bd-d4e5-4d66-bef4-ef135fd473ba\"}],\"header\":\"noch keine Werte\"},{\"position\":{\"x\":18.306636155606405,\"y\":97.3537784679089},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Wenn du alles fertig eingestellt hast und einmal kurz überprüft hast, wie viele Credits verbraucht werden, dann starte die Analyse. Mit der Analyse wird ein neuer Layer erstellt, der in den euren Ordner für dieses Projekt gespeichert wird.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Analyse durchführen\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Analyse durchführen\"},\"subContentId\":\"0f3ce198-32c3-46ab-b01b-bdf46b35ff19\"}],\"header\":\"Analyse durchführen\"}],\"hotspotNumberLabel\":\"Hotspot Nummer #num\",\"closeButtonLabel\":\"Schließen\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABeIAAAM4CAYAAACgCpJBAAAKE2lDQ1BJQ0MgUHJvZmlsZQAASImVlgdQFOkSx7+ZzYmwC0uGJWcks4DknCRIFpVlF5YlCUsUERU5PIETRUQETMgRFTw94qEiBgwcAgqYb5FDQDkPA6CCcoNcrKv3Xr2u6q9/1TPT3d/MVzV/AEjhrMTEOFgEgPiEFL6fiz0jOCSUgRsHRCAOyEAEEFjs5EQ7Hx9PgNgf8Z82PwKglXhXd6XWv6//VxPlRCazAYB8EI7jJLPjEe5C2JqdyE9BeAlh5fSURIRhBsJifGRAhI1XmLvKriscscphX+7x93NAOBEAPJnF4nMBIGYheUYam4vUIVYirJ/A4SUg3PelVzSLAwCJjLBOfPyWFWYirBHxtzrcf9SM+LMmi8X9k1f38sWoPC8Wm6ERy4rjRfB5kfwUzf/zxfwvi49L/aPXytsncyIdnZCohLgs4AEvwAJswAAaIBahOCQTAfjIGomsKQAZJiUyI2XlYYctiVv5PG50CsMO+XqRDLcEtp4Ow1DfwByAlbOw2uIt/UsXiH7rr1xSNwDm+UiS+1eOpQxAx3MAaPN/5ZTfIOPtB+DCADuVn7aaQ68sGOSUCQMxIAXkgTIyqS4wBKbAEtgCJ+AOvIE/CAGbkF1Eg3hk6nSQBXaBPFAA9oNDoBwcB6dAHTgDzoE20AUug+vgNhgAw+AREIAJ8BLMgnmwCEEQDqJANEgKUoBUIW3IEGJC1pAT5An5QSFQOMSFEqBUKAvaDRVAxVA5dBKqh76DOqDL0E1oEHoAjUHT0BvoI4yCybAYLAerwWtgJmwHe8D+8EaYCyfBmXAuvA8ug6vg03ArfBm+DQ/DAvglPIcCKBKKjlJE6aKYKAeUNyoUFYXio7JR+ahSVBWqCdWJ6kXdRQlQM6gPaCyahmagddGWaFd0AJqNTkJnowvR5eg6dCv6Kvouegw9i/6MoWBkMdoYC4wbJhjDxaRj8jClmBpMC+YaZhgzgZnHYrF0rDrWDOuKDcHGYLdhC7FHsc3Ybuwgdhw7h8PhpHDaOCucN46FS8Hl4Y7gTuMu4YZwE7j3eBJeAW+Id8aH4hPwOfhSfAP+In4IP4lfJIgQVAkWBG8Ch7CVUESoJnQS7hAmCItEUaI60YroT4wh7iKWEZuI14iPiW9JJJISyZzkS+KRdpLKSGdJN0hjpA9kKlmL7EAOI6eS95Fryd3kB+S3FApFjWJLCaWkUPZR6ilXKE8p74VoQnpCbkIcoR1CFUKtQkNCr4QJwqrCdsKbhDOFS4XPC98RnhEhiKiJOIiwRLJFKkQ6REZF5kRpogai3qLxooWiDaI3RaeoOKoa1YnKoeZST1GvUMdpKJoyzYHGpu2mVdOu0SbEsGLqYm5iMWIFYmfE+sVmxanixuKB4hniFeIXxAV0FF2N7kaPoxfRz9FH6B8l5CTsJCIl9ko0SQxJLEjKSNpKRkrmSzZLDkt+lGJIOUnFSh2QapN6Io2W1pL2lU6XPiZ9TXpGRkzGUoYtky9zTuahLCyrJesnu032lGyf7JycvJyLXKLcEbkrcjPydHlb+Rj5EvmL8tMK
